const a = <h1>hello world</h1>

function menubar(){
    return(
        <div className="Ui stackable menu">
            <a className="item"> Ho</a>
            <h1></h1>
        </div>
    )
}
const element = <menubar />

ReactDOM.render(
  <React.StrictMode>
    <menubar/>
  </React.StrictMode>,
  document.getElementById('root')
);

